// src/components/Navbar.jsx
import React from "react";
import { Link } from "react-router-dom";
import "../styles/App.css";

const Navbar = () => {
    return (
        <nav className="navbar">
            <Link to="/">종목검색</Link>
            <Link to="/financial-statements">재무제표</Link>
        </nav>
    );
};

export default Navbar;
